svg.script:
    

    var target = null;

    function startDrag(id) {
        target = document.getElementById(id);
    }

    function endDrag(id) {
        target = null;
    }

    function doDrag(evt, id) {
        if (target != null) {
            var x = evt.clientX;
            var y = evt.clientY;
            target.setAttribute('x', x - 50);
            target.setAttribute('y', y - 50);
        }
    }
